Αποκλείεται  
Για διαφήμιση το κάνει, είναι της μόδας. Τώρα το θυμήθηκε; 20 χρόνια γιατί δεν το έλεγε;

#Μιλα #μπεκατωρου #ΖεταΔουκα #Κιμουλης #ΜεΤηΣοφια https://t.co/KTvpav8mL1

Τι δουλειά ειχε η Μπεκατωρου μόνη της στο δωμάτιο ενός άνδρα;
Τι δουλειά είχε η Ζετα Δούκα στο θέατρο με τον Κιμούλη;
Τι δουλειά έχουν οι γυναικες στον αθλητισμό;
Τι δουλειά έχουν οι γυναικες σε θέσεις εργασίας;

Το θέμα είναι πολιτικο λοιπόν; 
Εχει σημασία αν ο θύτης αριστεροφερνει ή δεξιοφερνει; τα θύματα; επίσης; οποτε εγώ να περιμένω να διαβάσω και άρθρα με την κύρια Δούκα για συζητήσεις ως υποψήφια σε συριζα; 
#μπεκατωρου #Δουκα #Κιμουλης

Την μια ευαγγελιζεται υπερ της Μπεκατώρου αλλά την άλλη η Σκορδά "κόβει" το τι πραγματικά ειπε μια γυναικα.
Κατάλαβες πως εχουν τα πραγματα;
Δεν μπορουν ολοι να γινουν Ellen κ Oprah ξαφνικά. Εξου κ ο ερχομος Λιαγκα. #toprwino

«Πιστεύω πως είναι της μόδας οι καταγγελίες τύπου Μπεκατώρου»Καταλαβαίνετε τι είπε ο Γιώργος Κιμούλης με τόση ευκολία;
Καταλαβαίνετε γιατί θράσος μιλάμε; Με ποιο δικαίωμα εκμηδενίζει τον πόνο και τα τραύματα όλων όσων βρίσκουν θάρρος να μιλήσουν για όσα έχουν βιώσει; 
#Κιμουλης

Πάντως κύριε #Κιμούλη, εγώ ευχομαι να ήταν στην μόδα δηλώσεις σαν της Μπεκατώρου νωρίτερα.Επίσης εύχομαι αυτή η μόδα να γίνει και #alltimeclassic. 

Θα με είχε γλυτώσει απο πολύ χρόνο να αποδεσμευτώ απο την δική μου ευθύνη σε μερικές ιστορίες. #metoo

